import AppBar from "@material-ui/core/AppBar"
import Toolbar from "@material-ui/core/Toolbar"
import MenuIcon from "@material-ui/icons/Menu"
import IconButton from "@material-ui/core/IconButton"
import { Button, makeStyles, Typography } from "@material-ui/core"
import { useHistory } from "react-router-dom"

const useStyles = makeStyles((theme) => ({
  root: {
    flexGrow: 1,
  },
  menuButton: {
    marginRight: theme.spacing(2),
  },
  title: {
    flexGrow: 1,
    display: "none",
    [theme.breakpoints.up("sm")]: {
      display: "block",
    },
  },
}))

const Navbar = (props) => {
  const classes = useStyles()
  return (
    <div className={classes.root}>
      <AppBar>
        {!isLoggedIn() ? (
          <GuestToolbar classes={classes}></GuestToolbar>
        ) : (
          <UserToolbar classes={classes}></UserToolbar>
        )}
      </AppBar>
    </div>
  )
}

const UserToolbar = (props) => {
  let history = useHistory()

  const redirect = (path) => {
    history.push(path)
  }

  return (
    <Toolbar>
      <Typography className={props.classes.title} variant="h6" noWrap>
        Social App
      </Typography>
      <Button color="inherit" onClick={redirect("/profile")}>
        Profile
      </Button>
      <Button color="inherit">Feed</Button>
      <Button color="inherit">Logout</Button>
    </Toolbar>
  )
}

const GuestToolbar = (props) => {
  return (
    <Toolbar>
      <IconButton
        edge="start"
        className={props.classes.menuButton}
        color="inherit"
        aria-label="menu"
      >
        <MenuIcon />
      </IconButton>
      <Typography className={props.classes.title} variant="h6" noWrap>
        Social App
      </Typography>
      <Button color="inherit">Login</Button>
    </Toolbar>
  )
}

function isLoggedIn() {
  return true
}

export default Navbar
